import { signInWithGooglePopup } from '../../utils/firebase/firebase.utils'

import './sign-in.styles.scss'

const SignIn = () => {

  const logGoogleUser = async () => {
    const respone = await signInWithGooglePopup()
    console.log(respone);

  }

  return(
    <div className='content-center pt-4'>
      <h1>Sign In Page</h1>
      <button type="button" className='login-with-google-btn' onClick={logGoogleUser}>Sign in with Google</button>
    </div>
  )
};

export default SignIn;
